import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

// Navbar Component
const Navbar = () => {
  const [scrolled, setScrolled] = useState(false);
  
  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };
    
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="logo">
        <h2>CSE Society: IIT ISM Dhanbad</h2>
      </div>
      <div className="nav-links">
        <Link to="/about">About Us</Link>
        <Link to="/" className="active">Home</Link>
        <Link to="/teams">Teams</Link>
        <Link to="/bytestreams">Bytestreams</Link>
        <Link to="/buffered-readers">Buffered Readers</Link>
      </div>
    </nav>
  );
};

// Hero Section Component
const HeroSection = () => {
  return (
    <section className="hero-section">
      <div className="hero-content">
        <div className="hero-text">
          <h1>MONSOON</h1>
          <h1>MARCH</h1>
          <h2>v 5.1</h2>
          <button className="read-btn">READ LATEST...</button>
        </div>
        <div className="hero-description">
          <h2>CSES Tech Insights</h2>
          <p>Past & Present.</p>
          <h3>Computer Science and Engineering Society's TECH JOURNAL</h3>
        </div>
      </div>
    </section>
  );
};

// Purpose Section Component
const PurposeSection = () => {
  return (
    <section className="purpose-section">
      <div className="section-header">
        <h2>PURPOSE</h2>
        <h3>What we Aim?</h3>
      </div>
      <div className="purpose-content">
        <p>
          The aim of the CSE Society is to create a dynamic and supportive 
          environment that nurtures the technical and creative abilities of 
          students in the field of computer science and engineering. We aim 
          to bridge the gap between theoretical knowledge and practical 
          application by organizing a variety of events, workshops, and 
          collaborative projects.
        </p>
      </div>
    </section>
  );
};

// Events Section Component
const EventsSection = () => {
  return (
    <section className="events-section">
      <div className="section-header">
        <h2>UPCOMING EVENTS</h2>
        <h3>Udbhav-2024</h3>
      </div>
      <div className="events-content">
        <p>
          Join us as we celebrate the essence of creativity, innovation, and 
          community at Udbhav 2024. Let's make this event a spectacular 
          success, and a memorable chapter in the history of our CSE 
          Department!
        </p>
      </div>
    </section>
  );
};

// Footer Component
const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-logo">
          <h3>CSE Society: IIT ISM Dhanbad</h3>
        </div>
        <div className="footer-links">
          <Link to="/about">About Us</Link>
          <Link to="/">Home</Link>
          <Link to="/teams">Teams</Link>
          <Link to="/bytestreams">Bytestreams</Link>
          <Link to="/buffered-readers">Buffered Readers</Link>
        </div>
      </div>
    </footer>
  );
};

// Main HomePage Component
const HomePage = () => {
  return (
    <div className="home-container">
      <Navbar />
      <HeroSection />
      <PurposeSection />
      <EventsSection />
      <Footer />
    </div>
  );
};

export default HomePage;
